__NUXT_JSONP__("/drugs/Pracinostat", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"929016-96-6",chebiId:"",chemicalFormula:"C20H30N4O2",definition:"An orally available, small-molecule histone deacetylase (HDAC) inhibitor with potential antineoplastic activity. Pracinostat inhibits HDACs, which may result in the accumulation of highly acetylated histones, followed by the induction of chromatin remodeling; the selective transcription of tumor suppressor genes; the tumor suppressor protein-mediated inhibition of tumor cell division; and, finally, the induction of tumor cell apoptosis. This agent may possess improved metabolic, pharmacokinetic and pharmacological properties compared to other HDAC inhibitors.",fdaUniiCode:"GPO2JN4UON",identifier:"C71708",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C1946"],synonyms:["2-propenamide, 3-(2-butyl-1-(2-(diethylamino)ethyl)-1h-benzimidazol-5-yl)-N-hydroxy-, (2E)-","HDAC Inhibitor SB939","PRACINOSTAT",a,"SB939","kaempferol 3-o-beta-d-(6-E-P-coumaroylglucoside)"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FPracinostat",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Pracinostat","2021-10-30T13:43:46.433Z")));